import React from "react";
import { Text, View, StyleSheet, Button, Image } from "react-native";
import { Ionicons } from '@expo/vector-icons'

const DetailScreen = ({ navigation }) => {
  return (
    <View>
      <View style={styles.gapMaker} />
      <View style={styles.lifeWithUsView}>
        <View style={styles.buttonStyle}>
          <Button
            title="Life With Hypsies"
            onPress={() => navigation.navigate("LifeWithHypsies")}
            color="teal"
          />
        </View>
        <Image
          style={styles.lifeWithUs}
          source={require("../../../assets/life-with-hypsies.jpg")}
        />
        <Ionicons name="md-checkmark-circle"/>
      </View>
    </View>
  );
};

const styles = StyleSheet.create({
  gapMaker: {
    marginTop: 60,
  },
  buttonStyle: {
    height: 100,
    width: 200,
  },
  lifeWithUsView: {
    flexDirection: 'row',
    justifyContent: 'space-around',
  },
  lifeWithUs: {
    height: 30,
    width: 30,
  },
});

export default DetailScreen;
